Error Register - регистр ошибки
Биты распределены следующим образом:
0 - Общая авария без разделения типа;
1 - токовая авария;
2 - авария по напряжению;
3 - авария по температуре;
4 - коммуникационная ошибка;
5 - авария/ошибка специфичная для профиля устройства;
6 - зарезервировано (всегда "0" при чтении);
7 - авария/ошибка производителя оборудования.
Бит общей аварии должен выставляться в любой аварийной ситуации (по логическому ИЛИ).
